import React from 'react';
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';

const GoogleLoginComponent = () => {

    const [redirectToSecurePage, setRedirectToSecurePage] = useState(false);

    const responseGoogle = (response) => {
      console.log(response)
      fetch('http://localhost:8000/user/auth?token='+ response.credential,{
        credentials: 'include',
      })
          .then((response) => response.json())
          .then((data)=>{
              console.log(data)

              if (data && data.secure_data) {
                  console.log("Good")
              }
          })
          .catch((error) => {
              console.error('Error:', error);
          })
  };

  return (
    <div>
        <GoogleOAuthProvider clientId="214220334130-6dsm28felqurhd2fg2htqcckn02ipk78.apps.googleusercontent.com">
            <GoogleLogin
              onSuccess={responseGoogle}
              onError={() => {
                console.log('Login Failed');
              }}
            />
        </GoogleOAuthProvider>
        {redirectToSecurePage && <Redirect to="/secure-page" />}
    </div>
  );
};

export default GoogleLoginComponent;
